import React,{Component} from'react'
import List from '../docpat.json'

export function Extract(props){
    let name_list=[]
    List.forEach((p)=>{
        if(p.name===props.name){
            name_list=p.patients.map((e)=>e[0])
            id_list=p.patients.map((e)=>e[1])
        }
    })
    console.log(id_list)
    return name_list
}
